class Index extends React.Component {
  render() {
    return (
      <React.StrictMode>
        <TopBar />
        <InfoPage video={backgroundVideo}/>
      </React.StrictMode>
    );
  }
}

ReactDOM.render(<Index />, document.getElementById('root'));


// If you want to start measuring performance in your app, pass a function
